import React from "react";
import Ndata from "./Ndata";
import Naat from "./Naat";

const Naveed = () => {
  return (
    <Naat
      key={Ndata[3].key}
      pic={Ndata[3].pic}
      cat={Ndata[3].cat}
      tit={Ndata[3].tit}
      link={Ndata[3].link}
      dlink={Ndata[3].dlink}
    />
  );
};

export default Naveed;
